import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "alert";
const pathData = "M8 387L200 34c12-23 34-34 56-34s44 11 56 34l192 353c6 10 8 20 8 30 0 33-27 64-64 64H64c-37 0-64-31-64-64 0-10 2-20 8-30zm280-106V153c0-17-14-32-32-32s-32 15-32 32v128c0 18 14 33 32 33s32-15 32-33zm6 110c0-21-17-38-38-38s-38 17-38 38c0 22 17 39 38 39s38-17 38-39z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
